import React from 'react';


const TannTrim = () => {
  const containerStyle = {
    width: '197px',
    height: '28px',
    top: '19px',
    left: '50px',
    fontFamily: 'Comme',
    fontSize: '20px',
    fontWeight: 400,
    lineHeight: '28px',
    letterSpacing: '0.55em',
    textAlign: 'left',
    background: 'black',
  };

  return (
    <div>
        <div style={containerStyle}>
        TANN TRIM
        </div>
    </div>
  );
}

export default TannTrim;
